import React from 'react'
import { useTypedSelector } from '../store'

const Notification = () => {
    const notification = useTypedSelector(state => state.Notification.message)

    if (notification) {
        return (
            <div className="Notification">
              {notification}
            </div>
          )
    }
    return (
        <div className="Notification">
        </div>
    )

  }

 export default Notification
